import React from "react";
import "./character.css"

const Character = (props) =>{
    return(
        <React.Fragment>
            <div className = "character_container">
                <h3 className = "character_name">{props.character.name}</h3>
                <p className = "character_species">{props.character.species}</p>
                <p className = "character_status">{props.character.status}</p>
                <img className= "chat\racter_image"src={props.character.image} alt></img>
            </div>
        </React.Fragment>
    )
}
export default Character;
